import './Home.css';
import './components/nav';
import axios from "axios";

export default function Home() {
 const getUser=function(){
  axios.get('http://localhost:8080/api/users')
  .then((reponse) => {
    return reponse.data[0]["name"];
  });
 }

  return (
    <div className="App">
     <nav name={getUser}/>
    </div>
  );
};
